import React, { useState } from 'react';


export const Skills = () => {

    const [languages, setLanguages] = useState([
        {
            id: 0,
            language : 'Java',
            points : [
                'Proficient with object oriented programming in Java.',
                'Built backend applications using Spring Boot framwork, including implenting REST APIs.'
            ]
        }, {
            id: 1,
            language : 'C',
            points : []
        }, {
            id: 2,
            language : 'C++',
            points : []
        }, {
            id: 3,
            language : 'Javascript',
            points : [
                'Built frontend applications using React framework.',
                'Built backend applications using NodeJS and Express frameworks.'
            ]
        }, {
            language : 'Python',
            points : []
        }, {
            langauge : 'SQL',
            points : [
                'Worked with Postgres and SQLite.'
            ]
        }
    ]); 

    const [otherSkills, setOtherSkills] = useState([
        {
            skill : 'Mathematics',
            points : [
                'Strong foundations in calculus, linear algebra, discrete math and statistics.'
            ]
        }
    ]);

    return (
        <>
        <div className='skills'>
            <section className='programming_languages'>
                <h2>Programming Languages</h2>
                <ul>
                    <li>C</li>
                </ul>
            </section>

            <section className='frameworks'>
                <h2>Frameworks</h2>
                <div className='framework'>
                    <h3>React</h3>
                    <img src='/images/react.jpeg' alt='React'/>
                </div>
                <div className='framework'>
                    <h3>NodeJs</h3>
                    <img src='/images/nodejs.jpeg' alt='Node JS'/>
                </div>
                <div className='framework'>
                    <h3>Spring Boot</h3>
                    <img src='/images/springboot.jpeg' alt='Spring Boot'/>
                </div>
            </section>  
        </div>
        <p>Here are the set of programming languages and respective frameworks that I have studied or worked with in the past.</p>
        </>
    );
}
